import React from 'react';
import styled from '@emotion/styled';

const Time = (props) => {
    const Time = styled.h1`
    font-family: 'Fira Sans', sans-serif;
    font-size: 2rem;
    font-weight: 200;
    `
    var time = props.temp
    return (
        <>
            <Time>6PM</Time>
        </>
    )
}

export default Time;
